db.LIItemLines.updateOne(
  { itemId: "RV02" },
  {
    $set: {
      angleId: "AEN08",
      microPhrase: "You are open to pre-marital counseling",
      howYouBehaveIfUnhealthy:
        "There is a tendency for us to be resistant to premarital counseling.",
      whyItIsUnhealthy:
        "Premarital counseling uncovers aspects of our partner and relationship which we are unaware of. It helps us to know some non-negotiable aspects of our partner. It is good to know these aspects before we marry them rather than after marriage.",
      howYouBehaveIfHealthy:
        "You look forward to having a premarital counseling session.",
      whyItIsHealthy:
        "Visiting a premarital counselor can help you discover new parts of your relationship which were undiscovered before. This helps you understand each other better and builds a strong foundation for your relationship.",
      thingsToWatchOutFor: [
        "Your partner might feel that you are too dependent on the counselor for advice. Explaining to the partner the value of it can help them understand.",
      ],
      tipsToImprove: [
        {
          tipHeading: "Consult relationship expert",
          tipBody:
            "If you are comfortable opening up to a third party, we recommend you go to a counselor for premarital counseling.",
        },
        {
          tipHeading: "Assessments",
          tipBody:
            "Take psychometric assessments with your partner which facilitates conversations around crucial topics of marriage. This helps you get comfortable with the idea of being open to different experiences. We at HappilyEver offer a self-diagnostic couple’s assessment. The report helps to facilitate conversations around crucial topics before you get married. ",
        },
        {
          tipHeading: "Discuss important topics ",
          tipBody:
            "If you are uncomfortable with the above two options then only go for this one. Sit with your partner and discuss some important topics before you get married. Some topics you can discuss with your partner are: Finances - Who pays for the household expenses?  Where to invest? In-laws - Will you stay with in-laws after marriage? When do you want to move out with your partner? Kids - When to have kids? How long do you have to wait to have kids?",
        },
      ],
    },
  }
);

