db.LIItemLines.updateOne(
  { itemId: "RV03" },
  {
    $set: {
      angleId: "AEN01",
      microPhrase: "You include your partner in decision making",
      whyItIsHealthy:
        "In a relationship, often a partner’s individual decision impacts both partners. Including your partner in making decisions makes your partner feel heard and valued in the relationship.",
      tipsToImprove: [
        {
          tipHeading: "Discussion",
          tipBody:
            "Sit down with your partner. Discuss how involved you want to be in your partner's decision-making and vice versa. Some couples want to involve their partner in small decisions such as what clothes to buy for themselves whereas some couples only want to include their partner in big decisions such as financial planning for the future. There’s no rule for the level of involvement however communicating very clearly to your partner is important. ",
        },
        {
          tipHeading: "Reward your partner",
          tipBody:
            "When you observe your partner including you in decision making, reward them. You can reward them by taking them out for a movie or a dinner date - anything they would love to do.",
        },
        {
          tipHeading: "Taking side",
          tipBody:
            "When you disagree on a decision, take their side occasionally. When you do this, mention this clearly to your partner. This makes your partner feel valued.",
        },
      ],
      thingsToWatchOutFor: [
        "At times, your partner might feel you are too dependent on them for your own decision-making. Your partner may not express that feeling. Be mindful of it.",
      ],
      howYouBehaveIfUnhealthy:
        "We tend to make decisions independently without consulting with our partners.",
      howYouBehaveIfHealthy:
        "In a relationship, often a partner’s individual decision impacts both partners. Including your partner in making decisions makes your partner feel heard and valued in the relationship.",
      whyItIsUnhealthy:
        "We make our partner feel excluded by not involving him or her in decision-making. The individual decision of one partner often affects the other partner. Making decisions without involving our partners would make them feel unheard and unvalued. Therefore, it is recommended that you discuss with your partner how much involvement you would like in their decisions.",
    },
  }
);

