db.LIItemLines.updateOne(
  { itemId: "RV05" },
  {
    $set: {
      angleId: "AEN02",
      microPhrase: "You maintain individual identity in your relationships.",
      whyItIsHealthy:
        "Having your individual identity is empowering and boosts your self esteem. It also has a healthy impact on your relationship.",
      tipsToImprove: [
        {
          tipHeading: "Everyday activity",
          tipBody:
            "Dedicate a specific time to yourself, where you can do something you enjoy alone. An example would be reading a book for half an hour, going for a run, or painting for half an hour. When you aren't sure what you like, think of what you liked when you were a child. Try that activity.",
        },
        {
          tipHeading: "Expressing Wants",
          tipBody:
            "Tell your partner what you want from the relationship rather than only paying attention to what your partner wants. You can do this by making a list of the top 2-3 things you want from the relationship.",
        },
        {
          tipHeading: "Spending time",
          tipBody:
            "Once a month dedicate some time to spend with your friends and family without your partner.",
        },
        {
          tipHeading: "Your values",
          tipBody:
            "Take a moment to think about the values that you and your partner hold differently. Be sure to hold onto your values after you understand how they are different from your partner's. You could, for example, value generosity, courage, and so on.",
        },
        {
          tipHeading: "Being aware",
          tipBody:
            "Write down a list of things you haven't been able to do because of your relationship. Let your partner write it as well. Exchange the list with each other. By doing this, you become aware of the things you sacrificed for one another. Each of you assists the other in doing the thing they sacrificed. This restores your sense of self.",
        },
      ],
      thingsToWatchOutFor: [
        "Your partner might feel that you are being selfish and self absorbed. He/she might also feel you are trying to get distant in the relationship. Communicating the importance of  why it’s necessary to spend time with yourself to your partner will help them get a new perspective.",
      ],
      howYouBehaveIfUnhealthy:
        "We involve our partner in almost everything we do. We do not give time to ourselves in doing things we like.",
      howYouBehaveIfHealthy:
        "Having your individual identity is empowering and boosts your self esteem. It also has a healthy impact on your relationship.",
      whyItIsUnhealthy:
        "When we do everything with our partners, we lose our identity. When we lose our individual identity, we are so focused on our relationship that we forget who we are. The relationship may feel stuck at some point. By spending time with ourselves, we can reconnect with what is meaningful to us and enhance the relationship we have with our partners.",
    },
  }
);

