db.LIItemLines.updateOne(
  { itemId: "RV07" },
  {
    $set: {
      angleId: "AEN05",
      microPhrase: "Mature at managing expectations.",
      howYouBehaveIfUnhealthy:
        "If our partner doesn't match our expectations, we tend to accept the situation and silently suffer.",
      whyItIsUnhealthy:
        "If our partner doesn’t meet our expectations, simply accepting the situation leads to resentment in the relationship. Resentment causes future conflicts which can eventually end the relationship. Without communication, our partner will not know our expectations, making the relationship sour. We also miss the opportunity to connect with our partner through a healthy discussion of the mismatch in expectations.",
      howYouBehaveIfHealthy:
        "You communicate, accommodate or find a middle ground when your expectations aren’t met. You understand that while things cannot always go as expected, you will become resentful if you don’t at least try to achieve a middle ground or communicate with your partner.",
      whyItIsHealthy:
        "Communicating about your expectations will help your partner know what you want from the relationship. You and your partner will have less conflicts when it comes to expectations since you are discussing it if there’s a mismatch. This makes the relationship much more smooth and healthy.",
      thingsToWatchOutFor: [
        "Communicating your expectations in a rude or aggressive way may lead to conflicts. Be mindful about the manner in which you talk to your partner as it may hurt their feelings. We recommend you to listen more and speak less.",
      ],
      tipsToImprove: [
        {
          tipHeading: "Being aware",
          tipBody:
            "Write down the expectations that weren’t met by your partner. Talk to your partner about it in a friendly way without hurting them. This will make your partner aware about expectations",
        },
        {
          tipHeading: "Middle ground",
          tipBody:
            "Discuss on how you can bridge the gap between your expectations and what your partner can and is willing to fulfill. For example, you have an expectation that your partner takes you on a date every week. However your partner cannot fulfill this expectation. Here a middle ground may be that you and your partner go on a long walk once in 2 weeks.",
        },
        {
          tipHeading: "Mutual exchange",
          tipBody:
            "You can offer to do something for your partner that they love in exchange for fulfilling your expectations. For example, your partner plans a vacation for you and you in exchange cook his/her favorite dish.",
        },
        {
          tipHeading: "Observe breath",
          tipBody:
            "If you are not able to effectively communicate your expectations to your partner because it triggers you and leads to a fight, try this breathing technique. When your partner says something you don’t want to hear, observe your breath as you are listening. This will help you stay calm and minimize the chance of you being aggressive.",
        },
      ],
    },
  }
);

