db.LIItemLines.updateOne(
  { itemId: "RV08" },
  {
    $set: {
      angleId: "AEN06",
      microPhrase: "Open to checking expectations",
      howYouBehaveIfUnhealthy:
        "We hesitate to go to a third neutral party to check if our expectations about our relationship and our partner are justified.",
      whyItIsUnhealthy:
        "We may feel it's unnecessary and unwanted to ask someone else whether our expectations about our relationship and our partner are fair especially after being questioned by our partner. Sometimes we think our expectations are 'fair' but we may not be aware that they are unfair from a society's point of view. This will hurt our relationship as our partner might feel overwhelmed and resentful. This also puts unnecessary pressure on our partner because of the unfair expectations.",
      howYouBehaveIfHealthy:
        "You know that sometimes getting a third person’s opinion on whether your expectations are justified from your partner can be helpful.",
      whyItIsHealthy:
        "You understand that it’s healthy to talk to a third neutral party to check if your expectations are fair. It's helpful to see things from a different perspective rather than just from your own point of view. This will help you to avoid having unrealistic expectations from your relationship.",
      thingsToWatchOutFor: [
        "Ensure the third party you are talking to is neutral. Try not to ask too many people for their opinions since multiple perspectives can be confusing. Also, let your partner know you're talking to a third party. You don't have to share what you said, but try to keep them in the loop about who you talk to, otherwise your partner might interpret this as a breach of privacy.",
      ],
      tipsToImprove: [
        {
          tipHeading: "Relationship Expert",
          tipBody:
            "Approach a relationship expert when the conflict between you and your partner is severe for a long time that it hurts your relationship.This will help you bridge the gap and connect with your partner.",
        },
        {
          tipHeading: "Reach out to a wise friend",
          tipBody:
            "If you feel your partner finds your expectation not fair and that you are not comfortable going to a relationship expert, call a friend who is wise and also you are comfortable opening up to. Start with discussing your expectations of your relationship. Ask them what they think about your expectations. Not only will you be able to connect with your friend through this practice, but you will also gain clarity about your thoughts and feelings.",
        },
        {
          tipHeading: "Google search",
          tipBody:
            "Write about your expectations from your partner. Google search your expectations and check if your expectations are justified. For example the search could be, I expect my partner to share his/his passwords. By doing this, you will be able to gain a better understanding of different perspectives.",
        },
        {
          tipHeading: "Approach directly",
          tipBody:
            "Ask your partner if they are already doing something which they feel is unfair. Find out what makes it unfair and discuss it with your partner.",
        },
      ],
    },
  }
);

