db.LIItemLines.updateOne(
  { itemId: "RV09" },
  {
    $set: {
      angleId: "AEN07",
      microPhrase:
        "You know that arguments are okay in the initial phase of a relationship.",
      howYouBehaveIfUnhealthy:
        "We expect everything to be rosy when we start dating our partner at the beginning of the relationship. We worry that arguments in the initial period are a bad sign.",
      whyItIsUnhealthy:
        "We get worried when we begin to have conflicts in the beginning stages of the relationship. We start to believe that we are not meant for each other. We avoid conflict, do not talk about things that truly matter, and stay unhappy, causing eventual breakups. Note that it’s not a big deal to overcome this. A relationship in its initial phase is characterized by a lot of change, so arguments are common.",
      howYouBehaveIfHealthy:
        "You are aware that a relationship's initial phase has conflicts and arguments. It will not be 'rainbows and roses' as people may believe.",
      whyItIsHealthy:
        "You understand that arguments are inevitable and bound to happen. You in fact connect deeper by understanding the differences between you and your partner. Arguments are a healthy sign of you not silently suffering but communicating about it. Arguments provide the opportunity to understand the person better.",
      thingsToWatchOutFor: [
        "Be sure that the fights do not escalate into physical or verbal abuse. Attempt to resolve the conflict without prolonging it at a pace that works for you and your partner. Remember, in a relationship, it's okay to have arguments, so make sure your partner understands that it's common to have arguments.",
      ],
      tipsToImprove: [
        {
          tipHeading: "Patience does wonders",
          tipBody:
            "We only argue with those that we love. Giving time and space to understand each other better is vital.",
        },
        {
          tipHeading: "Use ‘I’ rather than ‘You’ ",
          tipBody:
            "Whenever there’s an issue that is bothering you, bring it up with your partner when both of you are in a good mood. Talk about it calmly and politely. Focus on ‘I’ statements such as ‘ I felt hurt when you didn’t take a leave from work to spend time with me.’ Do not blame your partner. Managing conflicts in a healthy way will help foster healthy relationships.",
        },
        {
          tipHeading: "First argument",
          tipBody:
            "When you and your partner have your first fight, celebrate it. Just like how you would celebrate your first kiss. You can give each other something meaningful as a gift. For example, a cute note of apology, ice cream, etc.",
        },
        {
          tipHeading: "Postpone the discussion",
          tipBody:
            "If you and your partner argued late at night, it’s okay to postpone the discussion. Leave the resentment behind and go to bed. The next day, follow up on the discussion.",
        },
        {
          tipHeading: "Re-discuss",
          tipBody:
            "If you have an unresolved conflict or an issue, ask your partner when you can discuss it. Each person processes things at a different pace. Hence it’s important to ask your partner when they can re-discuss. Make sure you respect their decision.",
        },
      ],
    },
  }
);

