      howYouBehaveIfUnhealthy:
        "When our relationship is in serious conflict, we do not seek external support.",
      howYouBehaveIfHealthy:
        "You reach out for external help to sort out issues in your relationship.",
      whyItIsUnhealthy:
        "We don't consider revealing severe problems of our relationship to a neutral person to find solutions and think it's shameful or awkward. We may not have realised that the fight has been going on for a long time and that solving it within ourselves is impossible in situations where conflict is intense. Sometimes without seeking external help the conflict cannot be resolved . Not solving it makes us lose our mental peace. Looking for alternative measures like external help can be the only way out in these cases.",
      angleId: "AEN16",
