          tipBody:
            "Whenever you and your partner get intimate, do it with an empty relaxed mind. No need to rush into it like they do in movies. \n\nHaving sex isn't the only way to be intimate. Sometimes looking into each other's eyes or just touching each other is intimate. Don’t have any specific, rigid expectations. For example, that sex should always include penetration, men should always be dominant, etc. \n\nIn the first few encounters, let it just happen naturally. Do what you like and let your partner also do the same. This will help you find your natural groove with your partner.",
