          tipBody:
            "As humans, we are inclined to yell back whenever someone shouts at us. Our instinct is to react defensively in such a way. \n\nHowever, this will negatively impact your relationship. Yelling back at your partner when they are already angry will lead to a even more heated argument. There is a possibility that you both will say mean things to each other, which might deeply hurt you both.",
