          tipBody:
            "After the issue has been resolved and some time has passed by, sit with your partner in a relaxed setting. \n\nAsk them to tell you their point of view on what happened. Resist the urge to correct them. Listen to them patiently. Then you do the same and ask your partner to only listen and not react. \n\nThis conversation will help you understand each other better regarding how your partner thinks and perceives. Realise that how both of your stories are so different for the same incident. Next time when an argument happens, you'll be able to understand your partner's perspective better.",
