          tipBody:
            "Consider your partner's negative qualities. Put them into three buckets:\nA. Not a big deal, can co-exist\nB. Conflicting but can co-exist with effort\nC. Can't co-exist\nFor those in B, discuss with your partner how to manage it together. For those in C, rethink your relationship. Give it some time to see if there are any smart ways to handle them. Seek external help if needed. This activity helps you better cope with your partner's negative qualities.",
