          tipHeading: "People don't change!",
          tipBody:
            "In the early stages of a relationship, we tend to ignore the negative qualities of our partner. We feel we can change our partner's negative qualities with love. We tend to think our partner would be willing to get influenced by us and correct themselves. \n\nIn reality, people rarely change. Love is not motivating enough for them to fix their negative qualities. Realise that, we can't change the negative quality, and eventually, it becomes a point of conflict. ",
