            "A healthy relationship requires many things to be right. You need to get 3 puzzles right - you, your partner and time. We often underestimate the amount of change involved. \n\nFirstly, you need to know what you want from your relationship. You need to know how much to adjust to make it work. \n\nSecondly, once you have a partner, you need to learn to accept their quirks and qualities you don't like.\n\nLastly, time and life constantly present us with new challenges we don't yet understand. For e.g. your partner loses their job and gets a new one in another city, you as a couple realize that you can't have children for whatever reasons. You can never be fully prepared for changes until they happen. Hence, it's healthy to accept that change is constant and we can never be completely prepared.",
