db.LIItemLines.updateMany(
  { angleId: "AEN31" },
  {
    $set: {
      howYouBehaveIfUnhealthy:
        "We do not change or go outside our comfort zone to make a relationship work.",
      whyItIsUnhealthy:
        "We don’t want to change or go outside our comfort zone to make a relationship work as changing is often uncomfortable. Changing is stressful hence most of us avoid it. We need to take into account that our partners come from different backgrounds, values, and belief systems. In order to find the right harmony with our partners, we need to adapt to different situations and go beyond our comfort levels.",
      howYouBehaveIfHealthy:
        "You go outside your comfort zone in order to make your relationship work.",
      whyItIsHealthy:
        "By stepping outside your comfort zone to make your relationship work, you show your partner that you are willing to put in the effort even if it is uncomfortable. The extra effort you put in will also encourage your partner to do the same. As a result, your relationship is strengthened as you are able to adapt to different situations.",
      thingsToWatchOutFor: [
        "If you constantly go beyond your comfort zone, your priorities, preferences, and values may be overlooked. Your partner may start expecting a lot of behavior, situations, etc beyond your comfort levels. Be clear with your partner about your limits.",
      ],
      tipsToImprove: [
        {
          tipHeading: "Knowing what is outside your comfort zone",
          tipBody:
            "Create a list of things within your comfort zone and things outside your comfort zone. Ask your partner to do the same. This list should have things that your partner expects of you but it are outside your comfort level. It will help you and your partner become more aware of things outside your comfort zones. For example: Situation - Partner expects you to watch a late-night movie with him/her. Within your comfort zone- Watching till 10 pm. Outside your comfort zone- Staying up late post 10 pm.",
        },
        {
          tipHeading: "Trying out activities beyond your limits",
          tipBody:
            "Share the 'outside comfort zone' list with your partner. Let your partner also do the same. Try to find a middle ground and move outside your comfort level. Example - Start watching the movie by 9 pm which ends by 11 pm. Here you are staying up a little late and also fulfilling your partner’s expectations.",
        },
        {
          tipHeading: "Questioning to get an insight",
          tipBody:
            'Question your partner politely to understand their perspective. For example- Rohan - Hey, why do you think ‘XYZ’ is outside your comfort zone? Sita - ‘their answer’ Rohan -  When do you think this ‘XYZ’ started? Sita -  ‘their answer’ Rohan - Say if you were stuck and you could only perform either ‘XYZ’ or something else which is worse, how would you bring yourself to do ‘XYZ’ Sita -: ‘their answer’ and so on and so forth. Identify the reasons why that particular behavior, action, thought, etc, might be outside their comfort zone. As human beings, we tend to make boundaries and likes/dislikes without any reasoning. You may be able to understand what is causing it to be "outside their comfort zone" if you ask probing questions.',
        },
      ],
    },
  }
);

