          tipId: "TIP201",
          tipHeading: "Everyday activity",
          tipBody:
            "Try to schedule some 'alone' time for yourself. Spend at least half an hour per day doing something you enjoy alone. An example would be reading a book or painting for half an hour, going for a run, and so on. \nWhen you aren't sure what you like, think of what you used to enjoy when you were a child. Try that activity. ",
