          tipHeading: "Expressing Wants",
          tipBody:
            "Don't only pay attention to what your partner wants. Tell your partner one thing you want from the relationship that you aren't getting. \nThis makes your partner aware of your wants. It will at least be in the back of their mind, whether it gets fulfilled or not. If you don't even express it to your partner, they won't even be aware and it will never get fulfilled.",
