          tipId: "TIP501",
          tipHeading: "How to express",
          tipBody:
            "If talking about your unmet expectations feels difficult for you, follow this process. This helps you have a smooth conversation. \n\nFirstly, find a time when your partner is relaxed and has some time to talk. Mention how much you care about them and how you want both of you to be happy. Wait for their reaction. It is usually neutral or positive. This builds trust and makes what you are about to present easier to absorb. \n\nThen talk about your unmet expectations, focusing mostly on where you are coming from and how it would make you quite happy. Once you are done, let your partner speak freely. They may react positively or negatively. Either way, listen attentively and resist the urge to stop them. \n\nIf the discussion doesn't proceed as planned, apologize and mention we can discuss this later. Overall you at least got a chance to maturely bring it up. It will remain in the back of their minds.",
