            "Sex is something people usually shy away from talking about with their partner. It's normal to feel shy. \n\nHowever, understand that sex is an integral part of your relationship. Your sex life will impact all the other aspects of your relationship. Not talking about it will eventually make you and your partner unhappy. Finding a way out to talk about what you want is crucial, even if doesn't seem easy.",
