db.LIItemLines.updateMany(
  { angleId: "AEN15" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP15101",
          tipHeading: "Arguing is not bad",
          tipBody:
            "Some of us might think that to keep peace in the relationship, we can skip some critical topics if it would cause a disagreement. Note that in a relationship, conflicts are inevitable. \n\nIt is unhealthy to avoid conflict by not discussing important issues. Silently suffering through it makes you unhappy slowly over time. Eventually, the issues you swept under the rug will surface and lead to even more serious conflict. \n\nTherefore, addressing the pressing issues is important even if it means risking conflict. ",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15101.png",
        },
        {
          tipId: "TIP15102",
          tipHeading: "How to have a crucial conversation?",
          tipBody:
            "If talking about the concerns feels difficult to you, follow this process. This helps you have a smooth conversation. \n\nFirstly, find a time when your partner is relaxed and has some time to talk. Once you start talking, mention how much you care about them and how you want both of you to be happy. Wait for their reaction. It is usually neutral or positive. This builds trust and makes them ready to absorb what you are about to present. \n\nThen talk about your concern, focusing mostly on where you are coming from, what your feelings are and how addressing it would make you feel better. Once you are done, let your partner speak freely. They may react positively or negatively. Either way, listen attentively and resist the urge to stop them. \n\nIf the discussion doesn't proceed as planned, apologize and mention we can discuss this later. Overall you at least got a chance to maturely bring it up. It will remain in the back of their minds.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15102.png",
        },
        {
          tipId: "TIP15103",
          tipHeading: "Pen it down",
          tipBody:
            "When you feel you can't talk to your partner about something important, write it down. Be gentle when expressing concern. Avoid harsh or abusive language. Do not blame your partner for the issue; instead, focus on yourself. Share it with your partner once you're done.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15103.png",
        },
        {
          tipId: "TIP15104",
          tipHeading: "Go for a walk",
          tipBody:
            "Whenever you feel uncomfortable talking or writing about your concern, try having a conversation with your partner in a position where you are not facing each other. You can do this by going for a walk with your partner. When you are not making eye contact and facing away from each other, talking becomes less awkward.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15104.png",
        },
        {
          tipId: "TIP702",
          tipHeading: "Use ‘I’ rather than ‘You’",
          tipBody:
            "When you're making a point to your partner that sounds like an argument, use 'I' rather than 'you'. Use statements such as ‘I felt hurt' instead of 'You hurt me'. \n\nThis encourages the partner to be more open and less defensive. You come across as not blaming your partner but rather explaining your feelings. \n\nIn this way, rather than ego clashes and fault-finding, the discussion involves empathizing and finding solutions. This makes managing conflicts smooth.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN07/TIP702.png",
        },
      ],
    },
  }
);

