          tipHeading: "Being friendly ",
          tipBody:
            "Some couples think it's okay to not interact with their partner's parents especially if they are annoying. We may not realise that our relationship with our partner's parents impacts our relationship with our partner. \n\nParents play a significant role in your partner's life. When you're not on good terms with them, your partner will feel hurt, which will affect your relationship. \n\nIt also means we are discarding our own support system. As we age, we and our partner's parents will need each others' support whether we like it or not. If the gap isn't bridged early on, it gets more difficult to bond and reconcile as time passes by. \n\nWe recommend that you at least be on talking terms with your partner's parents to have a smooth and healthy relationship with your partner.",
