          tipHeading: "Setting boundaries is hard",
          tipBody:
            "It is often difficult to draw boundaries, i.e. to communicate what is okay and what is not okay with our parents. Since we are raised by them, we have a general tendency to obey them. Hence, setting a boundary may seem like going against them. \n\nHaving no such boundaries will result in resentment and awkwardness. By discussing boundaries with them, we foster a healthy relationship in the long run.",
