          tipId: "TIP22102",
          tipHeading: "Crucial conversations",
          tipBody:
            "If talking about boundaries with parents feels difficult to you, follow this process. This helps you have a smooth conversation. \n\nFirstly, find a time when your partner's parents are relaxed and has some time to talk. Once you start talking, mention how much you care about them and how you want all of us to be happy. Wait for their reaction. It is usually neutral or positive. This builds trust and makes them ready to absorb what you are about to present. \n\nThen talk about the boundaries you want to draw, focusing mostly on where you are coming from, what your feelings are and how addressing it would make you feel better. Once you are done, let your partner's parents speak freely. They may react positively or negatively. Either way, listen attentively and resist the urge to stop them. \n\nIf the discussion doesn't proceed as planned, mention we can discuss this later. Overall you at least got a chance to maturely bring it up. It will remain in the back of their minds.",
