          tipHeading: "Use ‘I’ rather than ‘You.’",
          tipBody:
            "When you are expressing your feelings to your partner, use 'I' rather than 'you'. Use statements such as ‘I felt hurt' instead of 'You hurt me'. \n\nThis encourages the partner to be more open and less defensive. You come across as not blaming your partner but rather explaining your feelings. \n\nIn this way, rather than ego clashes and fault-finding, the discussion involves empathizing and finding solutions.",
