db.LIItemLines.updateMany(
  { angleId: "AEN29" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP29100",
          tipHeading: "Wait for 5 seconds",
          tipBody:
            "When our partner brings up an issue and we get irritated, we tend to become defensive and interrupt our partner. This makes them uncomfortable. We come across as dominating and impatient. The conversation becomes unpleasant from there onwards. \n\nThe best way to handle such a situation is to let them complete speaking, no matter how frustrated we might feel, and only start speaking after at least a 5 second gap from the time they are done speaking. ",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN29/TIP29100.png",
        },
        {
          tipId: "TIP29102",
          tipHeading: "Keep your palms up",
          tipBody:
            "When you find it hard to listen to your partner, sit down. Try placing your hands on your lap or the table with your palms facing up. Continue to listen without moving your palms. \n\nKeeping your palms open subconsciously makes you more willing to accept what the other person is saying. It'll help ground you and make it easier to listen to your partner.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN29/TIP29102.png",
        },
        {
          tipId: "TIP29103",
          tipHeading: "Code words",
          tipBody:
            "When we are not listening and feeling restless, often our partner can notice this long before we realise this ourselves. \n\nNext time when your partner notices this, have a protocol where your partner utters a code word such as 'yellow apples'. Choose a code word that we rarely use. This code word immediately makes you self aware of your restlessness while your partner is speaking. This gives you an opportunity to be a better listener and not interrupt. \n\nOnce you are done with the conversation, don't forget to thank your partner for what they have done.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN29/TIP29103.png",
        },
        {
          tipId: "TIP29104",
          tipHeading: "Finger Counting",
          tipBody:
            "Another technique to make it easier to listen is to count from 1 to 10 using your fingers. Stay at each finger for 3 seconds and then fold them one by one. It'll help you calm down and listen to your partner better. Interestingly, this technique also works in a reverse situation. If you notice your partner is getting irritated while you are speaking, stop speaking and then do the finger counting where they can clearly see your fingers folding. After this, either of you can start speaking to continue the conversation.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN29/TIP29104.png",
        },
        {
          tipId: "TIP29101",
          tipHeading: "Become self-aware",
          tipBody:
            "By knowing your triggers, you can change how you react when you are irritated. This helps you control negative emotions. \n\nTake a moment to reflect back on when you felt angry or irritated, and what triggered those feelings. Note down these situations. Mention the emotions you felt in each situation. For e.g, 'My partner said no to a movie date. This is the third time they said no. I felt irritated.' Recognize that them saying no is a trigger. Feeling irritated is your reaction to that trigger.\n\nList at least 10 such situations. It may take you 2-3 days to write them all down. \n\nThe next time you face a similar trigger, resist the temptation to react. Tell yourself 'I feel this strong emotion'. Wait for 5 seconds before reacting or walking away, whichever feels more comfortable. \n\nIn this way, you can control your negative emotions and improve the quality of your life.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN29/TIP29101.png",
        },
      ],
    },
  }
);

