db.LIItemLines.updateMany(
  { angleId: "AEN12" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP12100",
          tipHeading: "We own how we react",
          tipBody:
            "We tend to think that reacting aggressively when our partner provokes us is justified. We blame the partner. This is not healthy. We are responsible for our own emotions. We get angry not because someone provoked us, but because we got triggered. \n\nTriggers can be anything, such as a word, tone of voice, a past incidence, a thought, etc. Once we control our feelings, we can control the way we react to it. To take control of our feelings, we need to accept we are responsible for them. It is possible to still stay calm and react in a mature way even if our partner seems to provoke us.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12100.png",
        },
        {
          tipId: "TIP12101",
          tipHeading: "Discover your triggers",
          tipBody:
            "By knowing your triggers, you can change how you react. This helps you control negative emotions. \n\nTake a moment to reflect back on when you felt angry, sad, lonely, hopeless, etc., and what triggered those feelings. Note down these situations. Mention the emotions you felt in each situation. For example, 'My partner said no to a movie date. This is the third time they said no. I felt deeply hurt.' Recognize that them saying no is a trigger. Feeling hurt is your reaction to that trigger.\n\nList at least 10 such situations. It may take you 2-3 days to write them all down. The next time you face a similar trigger, resist the temptation to react. Tell yourself 'I feel this strong emotion'. Wait for 5 seconds before reacting or walking away, whichever feels more comfortable. In this way, you can control your negative emotions and improve the quality of your life.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12101.png",
        },
        {
          tipId: "TIP12102",
          tipHeading: "Emojis",
          tipBody:
            "If you are not great at identifying how you are feeling, get an emoji chart from Amazon and hang it on your wall. When you want to pin point your emotions, look at the various emojis in the chart and identify which ones you feel.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12102.png",
        },
        {
          tipId: "TIP12103",
          tipHeading: "Speed up",
          tipBody:
            "Consult a psychologist if you want to identify and address your triggers faster. You will be able to manage your emotions more effectively with their help.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12103.png",
        },
        {
          tipId: "TIP12104",
          tipHeading: "Release your anger",
          tipBody:
            "When you feel restless or have pent up emotions, try the primal scream technique to relieve them. Go somewhere you can't be heard. Let out a loud scream for as long as you can. Repeat it until you feel calm. \n\nIf you are into art, you can express your anger through coloring or painting. It will help you cool down.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12104png",
        },
        {
          tipId: "TIP12105",
          tipHeading: "Talk to someone",
          tipBody:
            "If you cannot identify situations where you felt triggered, ask your loved ones for help. They can remember and identify some of them. \n\nMake a list of them and display them where you can see them every day. You'll slowly become aware of your triggers and eventually, you'll be able to control your reactions to them.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12105.png",
        },
      ],
    },
  }
);

