          tipBody:
            "We avoid being vulnerable as we fear being hurt or judged by our partner. Your upbringing also influences this quality. If people around you dismissed you when you were vulnerable in the past, you might have closed yourself off. \n\nUnfortunately, as a society, we teach men not to be vulnerable, claiming it makes you less masculine. Realize that being vulnerable needs courage. It in fact makes you stronger because people trust you more. It also helps you connect deeper.",
