            "Reaching out to your partner after a fight can be difficult because you fear how they may react. Sometimes we feel it's not our problem to make them feel better. Realise that your partner needs you the most when they are hurt and recovering. So we suggest that you embrace the fear. \n\nIt is also vital to put away your ego when it comes to your partner, as there is no ego in a relationship. Putting effort to reach out to them once you have recovered from a fight shows your unwavering support and how much you care for them. ",
