            "After letting go of your fear and ego post a heated argument with your partner, it might feel awkward to talk for a while. \n\nAfter you have recovered from the fight, stay with your partner. Position yourself, so your partner can see you or make your presence known. Physically being around your partner builds trust. \n\nThis action also calms your partner down. This will strengthen your bond. It allows you to relook at any unresolved issues that caused the original fight with a fresh perspective.",
