          tipHeading: "Intimacy is an ocean!",
          tipBody:
            "You may think you know everything about sex and discourage your partner's attempts to help you know more. However, learning about sex and intimacy is a lifelong process. There is never an end to it. \n\nThus, being open to learning about intimacy and addressing your partner's sexual interests makes your relationship more satisfying.",
