          tipHeading: "Start, stop and continue",
          tipBody:
            "Once in a while, you and your partner should discuss what specific things you want to try, change, or stop in bed. \n\nThose that you both enjoy doing in bed, keep doing them. Those that you both dislike in bed, stop doing them. Those that you want to try out, be open to experimenting or learning about them. \n\nThis exercise will help you to improve your sex life and feel more satisfied in bed.",
