db.LIItemLines.updateOne(
  { itemId: "RV04" },
  {
    $set: {
      angleId: "AEN09",
      microPhrase: "Realistic expectations about sex",
      howYouBehaveIfUnhealthy:
        "When having sex for the first time, we have unrealistic expectations. We think that the relationship will be in trouble if the sex doesn’t go well.",
      whyItIsUnhealthy:
        "Having unrealistic expectations about intimacy early in the relationship leads to unfair pressure on ourselves as well as our partner. The first few encounters don’t go that well because we are unaware of each other’s likes and dislikes in bed. It takes time to tune in with each other when it comes to physical intimacy. Unsatisfied sexual experiences in the beginning stage are quite common. Hence, it’s recommended to enjoy the experience rather than worrying too much about it.",
      howYouBehaveIfHealthy:
        "You have realistic expectations of physical intimacy in the beginning stage of the relationship. You understand that your relationship isn't in trouble if sex for the first time doesn't go well.",
      whyItIsHealthy:
        "You know that first-time sex is not an indicator of how your relationship is going to be with regards to physical intimacy. You are aware that it would take time for you and your partner to tune in with each other. You understand that likes and dislikes in bed can be communicated for a better sexual experience",
      thingsToWatchOutFor: [
        "You and your partner might be aware that sex for the first time didn’t go well and you both might choose to talk about it.  We recommend talking openly about it.",
      ],
      tipsToImprove: [
        {
          tipHeading: "Open discussion",
          tipBody:
            "Sit with your partner and have an open-minded conversation regarding your expectations and hopes before getting intimate for the first time.  By doing so, you can clear up unrealistic expectations and learn more about each other. Don’t hesitate to talk about gray areas or taboo topics such as having a threesome. Discuss the language you and your partner use while being intimate such as what you call your genitals or do you say for penetration.",
        },
        {
          tipHeading: "Pre-sexual experience",
          tipBody:
            "We tend to develop unrealistic expectations because of social influences such as movies, novels, pornographic content, etc. The sexual content in these influences is unrealistic and scripted. Watching too much porn may lead to Porn-Induced Dysfunction in which individuals don’t feel aroused when they get intimate with their partners in real life. Start by being aware that the sexual content in these influences is not real. Also, reduce the amount of time you are exposed to such unrealistic sexual content. We recommend you stop watching porn 2 weeks before you are planning to get intimate with your partner",
        },
        {
          tipHeading: "Post-sexual experience",
          tipBody:
            "Talk to your partner about what went well and what didn’t go well while you were being intimate. Be honest about it. Whatever things didn’t go as per expectations, try to rectify them for the next time.",
        },
      ],
    },
  }
);

