db.LIItemLines.updateOne(
  { itemId: "RV06" },
  {
    $set: {
      angleId: "AEN10",
      microPhrase: "You are patient in bed",
      howYouBehaveIfUnhealthy:
        " We expect sex to click instantly. We tend to be impatient and loose interest in our partner if sex is not working out after the first few initial encounters.",
      whyItIsUnhealthy:
        " When it comes to physical intimacy, expecting to tune in with our partner in a short period creates unwanted pressure on us and our partner. To enjoy sex, we need to have an open mind without any expectations from each other. There are a lot of factors that go into sex to make it work such as the right emotional connection, right sexual position, right time, right health, right location, etc. These factors may not align early in our relationship. However, we recommend you to trust your partner and be patient. Love will flourish! ",
      howYouBehaveIfHealthy:
        " You understand that it is okay to take a few months after the first intimate experience to find the right groove with your partner.",
      whyItIsHealthy:
        "Having patience to find the groove with your partner puts less pressure on both of you to perform. Both you and your partner can enjoy the journey rather than focusing on the outcome. Having an amazing sex life requires patience while finding your groove with your partner!",
      thingsToWatchOutFor: [
        "Accepting the fact that it might take months to discover the right groove with your partner does not mean you remain unsatisfied sexually. We recommend you to communicate your displeasure in bed to your partner and also consult a sex expert if needed.",
      ],
      tipsToImprove: [
        {
          tipHeading: "Be aware",
          tipBody:
            "It’s important to realise that it will take time for you and your partner to find the right groove with regards to physical intimacy. Try not to judge your partner instead understand them. Think about how you can improve your sexual life as you work through it slowly.",
        },
        {
          tipHeading: "Get intimate with an open mind",
          tipBody:
            "When you and your partner plan to get intimate, do it with an open mind. Don’t have any specific expectations such as sex should always include penetration, male partner should be dominant etc. In the first few encounters, let the process just flow. This will help you find your natural groove with your partner.",
        },
        {
          tipHeading: "Neutral Help",
          tipBody:
            "Consult a sex expert if you have waited for long enough and sex is still not working out. It can be beneficial to have a neutral party view on a matter in order to discover new things. The expert can help make your experience more enjoyable by guiding you and your partner.",
        },
      ],
    },
  }
);

