db.LIItemLines.updateOne(
  { itemId: "RV10" },
  {
    $set: {
      angleId: "AEN20",
      microPhrase:
        "Willingness to maintain a good relationship with partner’s family",
      howYouBehaveIfUnhealthy:
        "We tend to avoid interacting with our partner's parents if we don't get along with them.",
      whyItIsUnhealthy:
        "Avoiding parent's (partner's) parents since we don't like them is usually not healthy. Realize that they are a huge part of our partner's life and hence our life too. It is unpleasant for our partner to see us both not interacting. It means we are discarding our own support system. As we age, we both will need each other's support whether we like it or not. If the gap isn't bridged soon enough, it gets harder to bond and reconcile as time passes by. Therefore, it is important for us to be on good terms with our partner's family.",
      howYouBehaveIfHealthy:
        "You are open to interacting with your partner's family even if you don’t get along with them.",
      whyItIsHealthy:
        "Maintaining a good rapport with your partner’s family will strengthen your bond as a couple. Your partner will notice the effort you’ve put into maintaining a good relationship and will appreciate you for it. This also helps you become more adaptable when it comes to situations like this.",
      thingsToWatchOutFor: [
        "Sometimes it’s possible for you to go overboard in your attempts to get acceptance from your partner’s family. It’s important to be mindful and make sure that you don’t go against your own values in order to get acceptance from them. You should maintain a balance between being yourself and pleasing your partner’s family at the same time.",
      ],
      tipsToImprove: [
        {
          tipId: "TIP20101",
          tipHeading: "Bonding activities",
          tipBody:
            "Engage in activities that both you and your partner’s family enjoy. For example, playing board games, watching movies, etc. This will help you bond with them and you will start to enjoy their company.",
        },
        {
          tipId: "TIP20104",
          tipHeading: "Crucial conversation",
          tipBody:
            "Parents have a lot of experience and wisdom to share. Let the conversations with them be around learning from their experience. Discuss topics such as how they managed finances, what all health challenges they faced, how they managed work and kids, etc. This makes it easier to get along with them.",
        },
        {
          tipId: "TIP20103",
          tipHeading: "Favorite childhood memories",
          tipBody:
            "Engage in a conversation wherein both your partner and their parents can tell their favourite childhood memories together. You will be able to see things from a different perspective and will make it easier to get along with them. As a bonus, you’ll also get to hear cute stories of your partner’s childhood.",
        },
        {
          tipId: "TIP20102",
          tipHeading: "Five why’s to ask",
          tipBody:
            "Sit back and think about why you don’t get along with your partner’s parents. There may be certain attitudes of you or them which are not aligned. When you know what isn't working, sit down with your partner and their parents and ask them why. This will help you to understand where they are coming from. There may be certain attitudes that either you or they have which are not aligned.",
        },
      ],
    },
  }
);

