db.LIItemLines.updateOne(
  { itemId: "MV11" },
  {
    $set: {
      angleId: "AEN21",
      microPhrase:
        "Communicating regarding details of wedding traditions/expectations with partner's family",
      howYouBehaveIfUnhealthy:
        "We don’t tend to communicate enough about wedding expectations to our partner’s family. We may underestimate the amount of communication required to ensure a smooth wedding.",
      whyItIsUnhealthy:
        "We tend to not communicate frequently and in detailed (detail) about the wedding expectations to our partner’s family. These discussions can be long, awkward and exhausting. Hence, we tend to skip or avoid it. This results in an unhappy wedding experience. That’s why it’s important for us to communicate as frequently as possible, and predict possible scenarios that may occur. This is the best way to have a happy wedding.",
      howYouBehaveIfHealthy:
        "We tend to communicate minute details regarding wedding expectations to our partner’s family in a clear manner.",
      whyItIsHealthy:
        "Communicating minute details regarding wedding expectations to your partner’s family is a healthy practice. It helps build teamwork and creates a firm foundation of trust  between the families. Handling difficult situations and fulfilling promises brings both families closer and together. Handling difficult situations and fulfilling promises brings both families closer together.",
      thingsToWatchOutFor: [
        "Your overcommunication regarding the wedding might irritate the other side of the family. They might wonder why you are doing it. Let them know where you're coming from. Explain to them that a wedding is a complex process, and communicating is always helpful. Your intent is to have a happy marriage without any mistakes.",
      ],
      tipsToImprove: [
        {
          tipId: "TIP21101",
          tipHeading: "Discuss traditions and expectations",
          tipBody:
            "The families on both sides need to discuss what happens before, during, and after the wedding. What arrangements would be made for close relatives, friends, and well-wishers from both families. For example, sarees for immediate relatives. Discuss finances. Such as who would pay for the wedding and who would cover unexpected costs. Discuss on a high level who is responsible for what. As an example, the bride's dad is in charge of food, and the groom's brother is in charge of decorations.",
        },
        {
          tipId: "TIP21102",
          tipHeading: "Over communicate",
          tipBody:
            "A number of unforeseen situations can occur when planning a wedding, there may be unexpected wedding expenses, different family traditions, and so on. Maintain frequent communication and avoid making assumptions. There should be constant communication between wedding organizers on both sides. Hence it’s better to over-communicate than to under-communicate. This way, we can ensure the wedding goes smoothly.",
        },
        {
          tipId: "TIP21103",
          tipHeading: "Being grounded",
          tipBody:
            "Forgive your family for their mistakes and be empathetic. There will be a few surprises along the way. For instance, your family has a tradition that the groom rides a horse to the wedding. In spite of this, the groom's family was unable to arrange a horse and came by car instead. In such scenarios it’s recommended to be empathetic and enjoy the wedding.",
        },
      ],
    },
  }
);

db.LIItemLines.updateOne(
  { itemId: "RV11" },
  {
    $set: {
      angleId: "AEN23",
      microPhrase: "Having financial stability before getting married",
      howYouBehaveIfUnhealthy:
        "We prioritise getting married over our financial stability.",
      whyItIsUnhealthy:
        "We expect marriage to improve our lives compared to when we were single. Getting married makes it worse in this situation. Marriage brings in new expenses and financial responsibilities which we might be unable to fulfill, which will hurt our marriage even though we think otherwise. Planning your finances before getting married will make the whole process much easier.",
      howYouBehaveIfHealthy:
        "You plan your finances well before getting married",
      whyItIsHealthy:
        "Marriage itself brings higher financial pressure onto the relationship. Having your financial plans figured out makes the process easier. Also, in cases of emergency or unplanned expenses, you will have room to manage them and have no stress when it comes to your financial situation.",
      thingsToWatchOutFor: [
        "You may tend to have realistic expectations regarding the financial plan. Be prepared for any surprise expenses. A general tip is to save about 30% of your income. Account only for the daily expenses and necessities. You might plan for things that you want but don't need.",
      ],
      tipsToImprove: [
        {
          tipId: "TIP23101",
          tipHeading: "Get clarity on the expense",
          tipBody:
            "Compile all the expenses for the first twelve months of your marriage. This will help you understand your financial situation. Planning before marriage gives you an idea of what you are getting into financially. You can also sit down and discuss where you spend the most money as well as your daily expenditures. An example is that maybe you spend most of your money shopping for clothes while your partner is spending most of their money on food.",
        },
        {
          tipId: "TIP23102",
          tipHeading: "Plan your Income",
          tipBody:
            "You can plan your income opportunities, whether there are other ways for you to increase your income. For example, selling specific lands or properties you own. If possible, try to plan which areas you can reduce your expenses for. This will help you learn how to budget your money and will be beneficial in the long run.",
        },
        {
          tipId: "TIP23103",
          tipHeading: "Count on your Savings",
          tipBody:
            "Plan how much you can save when it comes to hidden benefits like certain tax exemptions regarding getting married. When you marry, your expenses become shared and reduced in aspects like rent. You can try contacting an expert for more details.",
        },
      ],
    },
  }
);

db.LIItemLines.updateOne(
  { itemId: "MV13" },
  {
    $set: {
      angleId: "AEN24",
      microPhrase: "Sharing finances in a marriage.",
      howYouBehaveIfUnhealthy:
        "We are not on the same page with our partner regarding finances in the relationship",
      whyItIsUnhealthy:
        "When our partner spends money on things that we don’t agree on, it causes conflict. It causes a difference in relationships that needs to be addressed. Also, not considering our partner when it comes to spending money can cause trust issues in the relationship. This shows a lack of transparency and causes conflict regarding the shared finances. Sharing the finances can help us understand how we spend and lead to a better connection.",
      howYouBehaveIfHealthy: "You make financial decisions with your partner.",
      whyItIsHealthy:
        "When you share your finances with your partner, it strengthens the trust in your relationship. This also establishes clear communication on what you want your partner to be involved in and what you don't want them to be involved in. Sharing your finances can help the expenditure in your relationship run more smoothly.",
      thingsToWatchOutFor: [
        "You might start questioning your partner's expenditure regarding their income. Try to avoid that. Instead, try to understand their point of view and address your point of view regarding that expenditure.",
      ],
      tipsToImprove: [
        {
          tipId: "TIP24101",
          tipHeading: "Be open about discussing money",
          tipBody:
            "Money is a sensitive topic, and you might think that it is anti-romantic to bring it up, but it is essential. Talk to your partner about where you spend your money, regardless of whether it's shopping or food. Be clear about this. You can still retain your privacy but discuss how much you put in joint and personal savings.",
        },
        {
          tipId: "TIP24102",
          tipHeading: "Get through the awkwardness",
          tipBody:
            "Starting a financial conversation with your partner can be awkward, but it is a vital conversation to have. The first step should always be acknowledging the discomfort and talking it out. Say to your partner, “Hey, I really feel like we should discuss our financial plans”. Next, open up about the positives, like how much you have saved and then bring in details about how much you spend. You can start small but make it a habit to have financial talks frequently.",
        },
        {
          tipId: "TIP24103",
          tipHeading: "Differentiating",
          tipBody:
            "Differentiate your expenses by categorising them as Recurring significant expenses that occur regularly, like rent. The other category is the Non-essential expenses. This will be ideal early on and helps in tracking. You can try maintaining a spreadsheet or budget tracker for better insight.",
        },
      ],
    },
  }
);

db.LIItemLines.updateOne(
  { itemId: "KK01" },
  {
    $set: {
      angleId: "AEN25",
      microPhrase:
        "Aligning with partner regarding finances before planning for a child",
      howYouBehaveIfUnhealthy:
        "We tend to prioritise having a child over financial alignment with our partner.",
      whyItIsUnhealthy:
        "There are many unforeseen expenses when a newborn enters your family. There are things beyond finances that make it stressful such as sleep, mom's health, work performance, etc. The additional misalignment of finance puts an additional burden on us. This impacts the quality of care you can provide to the child and affects the future environment they will grow up in. When you align your finances with your partner you can ease this financial burden for you and your partner.",
      howYouBehaveIfHealthy:
        "You align your finances with your partner while planning for a child.",
      whyItIsHealthy:
        "Having a solid financial plan with your partner while planning for a child eases the entire process. You will be able to enjoy the joys of parenthood and focus on your child. You will be able to give your child what they require.",
      thingsToWatchOutFor: [
        "You tend to worry too much about saving and planning finances for the child and not enjoy the process. Strike the right balance between financial management and having a child.",
      ],
      tipsToImprove: [
        {
          tipId: "TIP25101",
          tipHeading: "Prioritize",
          tipBody:
            "It is a family's first priority to ensure their children's well-being. At times we have pressure from society or our body clock ticking that makes us rush into having a child. You need to wait a little longer to get your finances in order. The baby would not be able to align after birth in that environment because it would be too stressful for us.",
        },
        {
          tipId: "TIP25102",
          tipHeading: "Consult and Revise",
          tipBody:
            "Consult other parents with newborns on how their journey has been. Make a note of what they have been spending on. Then sit with your partner and ask them what they want to spend on the baby. Then you can revise your monthly budget as there are many things to consider while planning for a child: healthcare, daycare, cribs, toys, and diapers. There are many one-time investments if you are having your first child. Account them in your monthly budget.",
        },
        {
          tipId: "TIP25103",
          tipHeading: "Start a kids fund",
          tipBody:
            "Allocate a separate fund for the kid and name it a kids fund. Discuss with your partner how much you are going to save and put in the fund. Be ready to accommodate saving for the child’s higher studies, it is essential to also add this to the budget as it is a duty of a parent to support the child until the child can sustain on their own.",
        },
      ],
    },
  }
);

db.LIItemLines.updateOne(
  { itemId: "RV12" },
  {
    $set: {
      angleId: "AEN26",
      microPhrase: "Communicating honestly",
      howYouBehaveIfUnhealthy:
        "When it comes to getting into a relationship, we don't mind lying a little.",
      whyItIsUnhealthy:
        "Dishonestly breaks the transparency in a relationship. A relationship is built on the foundation of trust. So when we start being dishonest, our partner will inevitably figure it out. It is never worth the effort to lie, even if it puts you at stake. It is often said that “To hide one lie, a thousand lies are needed.” So it is essential to realise that lying will not help you, and being truthful has more benefits.",
      howYouBehaveIfHealthy:
        "You are honest about yourself before getting into a relationship.",
      whyItIsHealthy:
        "Honesty is rare among people and is a trait your partner will appreciate. It strengthens the trust in the relationship because your partner can rely on your words. You will create a strong bond even if you reveal a grey area in your relationship. It shows consistency in your behaviour and helps your partner accept who you are.",
      thingsToWatchOutFor: [
        "Be mindful about how and when you open up. You can be sensitive about some truths so that your partner feels comfortable.",
      ],
      tipsToImprove: [
        {
          tipId: "TIP26101",
          tipHeading: "Don’t fear judgement",
          tipBody:
            "Love is kind. It understands wrongdoings. It doesn't judge. It accepts. It rejoices with the truth. When opening up to your partner about the truth, you might fear that you will be judged and that they won't accept you. You deserve a partner who accepts you despite your shortcomings. If they judge and reject you, then they don't deserve you. If they accept you, then you have found a true connection. Trust that your partner will understand your point of view. So, in that case, what is the point of lying?",
        },
        {
          tipId: "TIP26102",
          tipHeading: "Flaunt your flaws",
          tipBody:
            "Everyone has their own views and ideas. Accept that you have your flaws and that there are also differences when it comes to dating. Showing your flaws can be an attractive quality. This will make you more self aware and open with your partner.",
        },
        {
          tipId: "TIP26103",
          tipHeading: "Storytime",
          tipBody:
            "If you want to be open about your flaws, try starting with the story behind the flaw. You can explain the context and where the flaw originated from. When you explain its backstory, it helps your partner understand where you are coming from and makes the acceptance process easier.",
        },
        {
          tipId: "TIP26104",
          tipHeading: "On Paper",
          tipBody:
            "If you find the truth embarrassing or hard to open up about, try writing it down on paper. This helps you put down your thoughts, and writing makes the idea clearer and more concrete.",
        },
      ],
    },
  }
);

