            "Some of us might think that to keep peace in the relationship, we can skip some critical topics if it would cause a disagreement. Note that in a relationship, conflicts are inevitable. \n\nIt is unhealthy to avoid conflict by not discussing important issues. Silently suffering through it makes you unhappy slowly over time. Eventually, the issues you swept under the rug will surface and lead to even more serious conflict. \n\nTherefore, addressing the pressing issues is important even if it means risking conflict. ",
