          tipId: "TIP17103",
          tipHeading: "Timeout",
          tipBody:
            "When you realize you are feeling angry and can't control it, ask your partner for a short break. Walk away and take time for yourself. It could be as little as 30 minutes or as long as 12 hours. Distancing yourself from the situation will help you process what has happened. ",
