          tipBody:
            "Most of us find it difficult to say no. There could be numerous reasons for it, including not wanting the partner to get hurt, being brought up in a culture where saying 'no' is not an option, fearing the relationship will break if we say 'no,' or simply wanting to please our partner. \n\nAlways saying 'yes' to your partner is unhealthy. By doing so, you are slowly losing yourself. A healthy relationship requires you to say 'no' whenever you feel the need to do so.",
