db.LIItemLines.updateOne(
  { itemId: "RV01" },
  {
    $set: {
      negativeLine:
        "You may have not realized that relationships are characterized by change and you often need to change beyond what you think to make things work. You and your partner have come from different backgrounds, value systems, beliefs, expectations, and priorities. In order to find the right harmony with your partner, you would be challenged on each of the aspects above and hence it's the biggest change you would ever come across in your life.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV02" },
  {
    $set: {
      negativeLine:
        "You may think that it's not worth the time and money to consult a relationship expert when you are facing issues in your relationship. Most of us tend to reject partners too fast at the slightest discomfort. Few of us instead seek advice from friends or uncles/aunts. Note that their advice is often biased as they talk from their past experiences unlike trained experts. Being patient with your partner when issues arise and talking to an expert neutral party when these issues feel unsolvable ensures that you make the right decisions in relationships. This reduces heart breaks and ensures you don't miss out on a partner who is good though you are currently facing issues with him/her.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV02" },
  {
    $set: {
      negativeLine:
        "You may think that premarital counseling is for about-to-marry couples or maybe rich couples who are having issues. In reality, it is for all couples who are about to get married. It uncovers many blind spots in your relationship and helps you build a strong foundation for a happy marriage.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV03" },
  {
    $set: {
      negativeLine:
        "You tend to skip your partner when you make decisions that you feel your partner strongly disapproves of. This breaks trust and it's a matter of time before your partner finds out about this decision. You would have a much bitter conversation at that time. We rather suggest you to include a partner in all decisions, be affirmative and agree to disagree if you can't reach consensus. This builds enormous trust.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV04" },
  {
    $set: {
      negativeLine:
        "You may believe that if sex for the first time doesn't go well your relationship will be in trouble. But it won't. First time sex doesn't go well most of the time and it's quite normal. Not worrying too much about it and enjoying the next few experiences is what we recommend. More often than not things will be quite alright. However, if there are persistent issues in your sex life, we recommend you to consult urologist/psychiatrist.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV05" },
  {
    $set: {
      negativeLine:
        "You tend to believe that a happy relationship means the couple does everything together. However, that's far from the truth. It is important to have some “me” time in a relationship. Otherwise, you may stand to lose your individual identity and start to feel stuck in the relationship. Hence, we suggest you to give time to both yourself and your relationship.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV06" },
  {
    $set: {
      negativeLine:
        "You may think that it shouldn't take months to find a groove with your partner in bed. However, it's common for it to take time. For the groove to align, many elements should fall in place -  right emotional connection, overcoming misconceptions, right sexual position, right time, right health, right location, fighting infections, communication about how you want it and how often. If you are into your partner, please be patient. Love will definitely flourish! ",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV06" },
  {
    $set: {
      negativeLine:
        "You may think that it shouldn't take years to find a groove with your partner in bed. However, it's common for it to take time. For the groove to align, many elements should fall in place -  right emotional connection, overcoming misconceptions, right sexual position, right time, right health, right location, fighting infections, communication about how you want it and how often. If you are into your partner, please be patient. Love will definitely flourish!",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV07" },
  {
    $set: {
      negativeLine:
        "If your partner doesn't match your expectations, you might simply accept the situation and silently suffer. Here are a few ways to handle this better. First of all, communicate clearly to your partner that your expectations are not being met. Beyond that, you can confirm with a trusted neutral person that your expectations are fair and rethink about them if they are not. Secondly, you can discuss with your partner to see if you can find a middle ground between expectations and reality. Lastly, you can offer to do something new that your partner loves in exchange for fulfilling your expectations.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV08" },
  {
    $set: {
      negativeLine:
        "You may feel it's unnecessary and unwanted to ask someone else whether your expectations about your relationship and your partner are fair. Sometimes we think they are 'fair' but may not even be aware that they are unfair from a society's point of view. This will hurt your relationship as your partner might feel overwhelmed and resentful. Hence, we suggest you keep an open mind when it comes to confirming your expectations with a trusted neutral party.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV09" },
  {
    $set: {
      negativeLine:
        "You believe that arguments in the initial period of your relationship are unhealthy. In reality, it's common for couples to argue in the initial phase as it is a period of change and can be rocky. Patience does wonders. We only argue with those that we love. So, we recommend you to give time and space to get a better understanding of each other. ",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV10" },
  {
    $set: {
      negativeLine:
        "The older we get, the more stubborn and the less flexible our minds become. It's biological and natural. So, it's common for us to feel annoyed by our partner's parents. But they are a huge part of your partner's life, whether you like it or not. You don't need to connect with them but at least you should be in talking terms with them if your partner wants you to. If you don't, your partner may feel hurt and may never be fully content.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV11" },
  {
    $set: {
      negativeLine:
        "You may think that it's silly to communicate all the minutest details regarding a wedding to your partner's family. It's important to realize that weddings are a melting pot of our parents' emotions, dreams, status, high expectations and involve complex event management where there is never enough time. So, the risk of miscommunication and conflict regarding wedding traditions and expectations between two families is quite high. We suggest you communicate often and work closely with your partner's family to avoid bitterness just before your big day!",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV11" },
  {
    $set: {
      negativeLine:
        "You may think it's sensible to get married as you age even if you and your partner are not financially stable yet. We expect marriage to make our lives better compared to when we were single. Getting married actually makes it worse in this situation. Marriage brings in new expenses and financial responsibilities which you might be unable to fulfill which will hurt your marriage. We recommend you to first be financially stable and then get married.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV13" },
  {
    $set: {
      negativeLine:
        "For spending your own money, you may think your partner doesn't need to be considered in marriage. Money that you earn individually is still considered family income in marriage, whether you like it or not. It's crucial to be on the same page with your partner on how you spend it. We often have a strong opinion on how much to spend on what and when with family income. There's no right or wrong model on what to do with your own income. As long as you both communicate and come to consensus on how you are going to manage these finances, you should be good.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "KKG01" },
  {
    $set: {
      negativeLine:
        "You may plan for a child, especially if you are growing older, even if you don’t agree with your partner on finances around raising a child. This is not healthy. Prevention is better than cure. All important decisions in marriage often have financial ramifications. It's not easy to get money at the last moment when you need it. We suggest you first quickly reach consensus on finances around raising a child and then plan for one.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV12" },
  {
    $set: {
      negativeLine:
        "You believe that it is okay to lie about a few things before getting into a relationship, however this is one of the most common causes of conflict between the couple. The truth always comes out at some point of time. This leads to heated arguments and breaks trust which is not healthy. If your partner leaves you because you are being truthful, then you are better off without them. You deserve better. Being truthful is an extremely rare quality. Cherish it!",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ01" },
  {
    $set: {
      negativeLine:
        "You assume that with time and patience, you can change a negative quality or habit in your partner. It's healthy to communicate the change you want in your partner, but be mentally prepared for the scenario that might never happen. This reduces stress on you and your partner. Note that change puts us out of our comfort zone and hence we often dislike change even if it's for our own good. Marry your partner only if you can live with him/her never changing though it's quite possible that change might occur if you are lucky.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ02" },
  {
    $set: {
      negativeLine:
        "To avoid a fight with your partner, you have a tendency to avoid addressing issues. A stitch in time saves nine. Unaddressed issues over time lead to chronic illness and anger outbursts which will hurt you and your relationship. We often have times where we are feeling pleasant. We suggest you be patient, wait for when you both are feeling good and  softly bring these issues up. With the right intent, patience and communication, the majority of issues can be addressed.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ03" },
  {
    $set: {
      negativeLine:
        "You seem to be hesitant to discuss about sex with your partner if you believe the conversation will just be awkward. There is always a way to communicate even the most sensitive topics with a person. If speaking about it feels awkward, try to write it down and share with your partner. By not expressing, you are denying yourself and your relationship a chance to reach its full potential of sexual satisfaction. Often you will be pleasantly surprised how open your partner could be once you communicate. Communicating your likes, dislikes and fantasies in bed with your partner is a key to a healthy sex life.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ04" },
  {
    $set: {
      negativeLine:
        "If your partner's hobbies/interests are not your cup of tea, you may be reluctant to engage in them. We usually don't do what we don't like as that makes us uncomfortable. Realize that trying to engage in at least one such activity helps you connect with your partner at the next level. You may not lose much if you don't engage, but you will gain tremendously if you engage. Hence, we suggest you sometimes get involved in your partner's hobbies or interests.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ05" },
  {
    $set: {
      negativeLine:
        "You don't consider revealing serious problems between you and your partner to a neutral person to find solutions and may think it's shameful. You may have not realized that in situations where conflict is severe, solving it just within yourselves is not possible. Seeking external help can be the only way out. Not solving it impacts your health due to high stress that is involved. Also, neutral trusted third parties keep secrets and are trained at it. Your heart feels light once you share and lays the foundation for an amicable solution.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ06" },
  {
    $set: {
      negativeLine:
        "You may give up too easily if your partner doesn't understand something you say. It is important to realize that people interpret things differently, and you may need to explain a few times before your partner finally understands your perspective. Not showing willingness to explain might make your partner feel dumb/insulted. Patiently explaining your partner shows that you value them and your relationship.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ07" },
  {
    $set: {
      negativeLine:
        "It is understandable and natural to lose your cool if your partner yells at you for something that is not your fault. However, you may have not realized that this can escalate into a huge fight where you may say things that deeply hurt your partner. Hence, it's advisable to calmly say that you disagree and let them vent out completely before you speak. Listening is showing love. Once things are settled, have a discussion with your partner about how you felt and how your partner can communicate in a better way the next time if he/she is annoyed.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ08" },
  {
    $set: {
      negativeLine:
        "You prefer to believe that it is not your fault to get aggressive if your partner provokes you. There are ways in which we can react peacefully even in such situations. Reacting aggressively does more damage than good in most situations. We consciously or subconsciously choose to react to triggers that surround us. Identifying these triggers and becoming aware of them is quite hard but the only way for a happy life. Being aware of them makes it much easier to control our reactions. Seeking professional help to learn how to identify these triggers and change the way you react is advised.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ09" },
  {
    $set: {
      negativeLine:
        "You hesitate to expose your vulnerable side to your partner because you think it's a sign of weakness. Note that sharing a vulnerable side releases Oxytocin hormone in the listener and actually builds trust. Also, it is a sign of bravery and hence you need to be proud of it. This is a big part of emotional intimacy we seek with our partners. It is natural to feel afraid when you are new to it. Taking small steps such as talking to your partner about little things you normally keep private may be a good start. Gauge how they are reacting when you do that. Sharing your vulnerable side to your partner is a pathway to a  happy relationship.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ10" },
  {
    $set: {
      negativeLine:
        "You may not prefer to do things that you dislike that you can live with and that your partner expects you to do. Realize that relationships are about compromise and the level of compromise varies among couples. If you look objectively, you would realize that there are things your partner expects of you, that you usually object to, for which there could be creative ways of managing them and that is not a big deal for you to try it out. For e.g., there could be things you want your partner to do that they aren't doing. You can have a discussion on trading one for the other where you will do something they like if they do something you like. Relationships make us flexible and better people. Let's enjoy the process and be less stubborn about what we object to.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ11" },
  {
    $set: {
      negativeLine:
        "You may have not considered discussing boundaries with your parents regarding how much involvement they can have in your personal affairs. We usually skip this discussion to avoid awkward conversations. Unknowingly your parents would cross the line over time that would annoy you and your partner. Prevention is better than cure. Communicating such sensitive matters in a non-awkward way is possible. It would ensure that both your parents and your partner live peacefully without stepping into each other’s  boundaries. We suggest you come to an agreement with your partner and their families when the time is right on how much say they can have in your personal affairs for happy relationships.",
    },
  }
);

db.LIItemLines.updateOne(
  { itemId: "CQ12" },
  {
    $set: {
      negativeLine:
        "In situations where you both had a fight and you bounced back to normal but your partner hasn't yet, you may not be handling them well. It is recommended to reach out to your partner who is still going through the pain and show compassion despite how you are feeling about what happened. For e.g., you can ask your partner if you can do anything to make them feel better.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ13" },
  {
    $set: {
      negativeLine:
        "When you and your partner are having a dull sex life and they offer you to read a book by a renowned expert, you may not take it in a positive light. Sex is a sensitive topic and each of us have different ways to express what we want. We suggest you to appreciate your partner for what he/she did, inquire about the intent and figure out the next steps on how to make sex more pleasurable.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ14" },
  {
    $set: {
      negativeLine:
        "You may not be communicating hard feelings to your partner in an effective manner. You may be trying to either avoid expressing or express in an indirect manner about how you are feeling. This builds resentment over time. There are ways to talk about sensitive topics with your partner. Getting trained in how to have crucial conversations in a healthy manner is recommended. This helps build trust, make you feel heard and be happy in your relationships.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "CQ15" },
  {
    $set: {
      negativeLine:
        "In situations where you feel irritated by what your partner said, you may find it difficult to listen and tend to react in unhealthy ways. It is quite common and natural for us to do this. Self-restraint when our ego is being questioned is one of the hardest things to do. But it is possible. There are few exercises one can do to build restraint. Good listeners are great at identifying their own triggers, have a lot of self-restraint, and are compassionate. Listening is how they show love and they let their partners complete their sentences though they don't like what they are listening to. It is one of the best peaceful ways to coexist and lead a happy life.",
    },
  }
);

db.LIItemLines.updateOne(
  { itemId: "RVO1" },
  {
    $set: {
      negativeLine:
        "You may have not realized that relationships are characterized by change and you often need to change beyond what you think to make things work. You and your partner have come from different backgrounds, value systems, beliefs, expectations, and priorities. In order to find the right harmony with your partner, you would be challenged on each of the aspects above and hence it's the biggest change you would ever come across in your life.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RVO2" },
  {
    $set: {
      negativeLine:
        "You may think that it's not worth the time and money to consult a relationship expert when you are facing issues in your relationship. Most of us tend to reject partners too fast at the slightest discomfort. Few of us instead seek advice from friends or uncles/aunts. Note that their advice is often biased as they talk from their past experiences unlike trained experts. Being patient with your partner when issues arise and talking to an expert neutral party when these issues feel unsolvable ensures that you make the right decisions in relationships. This reduces heart breaks and ensures you don't miss out on a partner who is good though you are currently facing issues with him/her.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV02" },
  {
    $set: {
      negativeLine:
        "You may think that premarital counseling is for about-to-marry couples or maybe rich couples who are having issues. In reality, it is for all couples who are about to get married. It uncovers many blind spots in your relationship and helps you build a strong foundation for a happy marriage.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV03" },
  {
    $set: {
      negativeLine:
        "You tend to skip your partner when you make decisions that you feel your partner strongly disapproves of. This breaks trust and it's a matter of time before your partner finds out about this decision. You would have a much bitter conversation at that time. We rather suggest you to include a partner in all decisions, be affirmative and agree to disagree if you can't reach consensus. This builds enormous trust.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV04" },
  {
    $set: {
      negativeLine:
        "You may believe that if sex for the first time doesn't go well your relationship will be in trouble. But it won't. First time sex doesn't go well most of the time and it's quite normal. Not worrying too much about it and enjoying the next few experiences is what we recommend. More often than not things will be quite alright. However, if there are persistent issues in your sex life, we recommend you to consult urologist/psychiatrist.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV05" },
  {
    $set: {
      negativeLine:
        "You tend to believe that a happy relationship means the couple does everything together. However, that's far from the truth. It is important to have some “me” time in a relationship. Otherwise, you may stand to lose your individual identity and start to feel stuck in the relationship. Hence, we suggest you to give time to both yourself and your relationship.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV06" },
  {
    $set: {
      negativeLine:
        "You may think that it shouldn't take months to find a groove with your partner in bed. However, it's common for it to take time. For the groove to align, many elements should fall in place -  right emotional connection, overcoming misconceptions, right sexual position, right time, right health, right location, fighting infections, communication about how you want it and how often. If you are into your partner, please be patient. Love will definitely flourish!",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV06" },
  {
    $set: {
      negativeLine:
        "You may think that it shouldn't take years to find a groove with your partner in bed. However, it's common for it to take time. For the groove to align, many elements should fall in place -  right emotional connection, overcoming misconceptions, right sexual position, right time, right health, right location, fighting infections, communication about how you want it and how often. If you are into your partner, please be patient. Love will definitely flourish!",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV07" },
  {
    $set: {
      negativeLine:
        "If your partner doesn't match your expectations, you might simply accept the situation and silently suffer. Here are a few ways to handle this better. First of all, communicate clearly to your partner that your expectations are not being met. Beyond that, you can confirm with a trusted neutral person that your expectations are fair and rethink about them if they are not. Secondly, you can discuss with your partner to see if you can find a middle ground between expectations and reality. Lastly, you can offer to do something new that your partner loves in exchange for fulfilling your expectations.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV08" },
  {
    $set: {
      negativeLine:
        "You may feel it's unnecessary and unwanted to ask someone else whether your expectations about your relationship and your partner are fair. Sometimes we think they are 'fair' but may not even be aware that they are unfair from a society's point of view. This will hurt your relationship as your partner might feel overwhelmed and resentful. Hence, we suggest you keep an open mind when it comes to confirming your expectations with a trusted neutral party.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV09" },
  {
    $set: {
      negativeLine:
        "You believe that arguments in the initial period of your relationship are unhealthy. In reality, it's common for couples to argue in the initial phase as it is a period of change and can be rocky. Patience does wonders. We only argue with those that we love. So, we recommend you to give time and space to get a better understanding of each other.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV10" },
  {
    $set: {
      negativeLine:
        "The older we get, the more stubborn and the less flexible our minds become. It's biological and natural. So, it's common for us to feel annoyed by our partner's parents. But they are a huge part of your partner's life, whether you like it or not. You don't need to connect with them but at least you should be in talking terms with them if your partner wants you to. If you don't, your partner may feel hurt and may never be fully content.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV11" },
  {
    $set: {
      negativeLine:
        "You may think that it's silly to communicate all the minutest details regarding a wedding to your partner's family. It's important to realize that weddings are a melting pot of our parents' emotions, dreams, status, high expectations and involve complex event management where there is never enough time. So, the risk of miscommunication and conflict regarding wedding traditions and expectations between two families is quite high. We suggest you communicate often and work closely with your partner's family to avoid bitterness just before your big day!",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV11" },
  {
    $set: {
      negativeLine:
        "You may think it's sensible to get married as you age even if you and your partner are not financially stable yet. We expect marriage to make our lives better compared to when we were single. Getting married actually makes it worse in this situation. Marriage brings in new expenses and financial responsibilities which you might be unable to fulfill which will hurt your marriage. We recommend you to first be financially stable and then get married.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "MV13" },
  {
    $set: {
      negativeLine:
        "For spending your own money, you may think your partner doesn't need to be considered. Money that you earn individually is still considered family income, whether you like it or not. It's crucial to be on the same page with your partner on how you spend it. We often have a strong opinion on how much to spend on what and when with family income. There's no right or wrong model on what to do with your own income. As long as you both communicate and come to consensus on how you are going to manage these finances, you should be good.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "KKG01" },
  {
    $set: {
      negativeLine:
        "You may plan for a child, especially if you are growing older, even if you don’t agree with your partner on finances around raising a child. This is not healthy. Prevention is better than cure. All important decisions in a relationship often have financial ramifications. It's not easy to get money at the last moment when you need it. We suggest you first quickly reach consensus on finances around raising a child and then plan for one.",
    },
  }
);
db.LIItemLines.updateOne(
  { itemId: "RV12" },
  {
    $set: {
      negativeLine:
        "You think it's okay to say 'yes' to everything your partner says. Realise that, you lose our own identity every time you say 'yes' to something you wish to say 'no' to. When this happens, you feel stuck in your relationship and unhappy. This leads to resentment as well. Hence it's important to say 'no' to your partner when you disagree with them.",
    },
  }
);
