          tipHeading: "At least say that you struggle to open up",
          tipBody:
            "If you feel uncomfortable opening up to your partner, you can talk to them about the feeling of discomfort itself. You can tell how hard it is for you to open up. \n\nThis conversation will give you the courage to open up more in the future. It will also help them understand your point of view better. Thus, it will improve your relationship.",
