        "Avoiding partner's parents since we don't like them is usually not healthy. Realize that they are a huge part of our partner's life and hence our life too. It is unpleasant for our partner to see us both not interacting. It means we are discarding our own support system. \n\nAs we age, we both will need each other's support whether we like it or not. If the gap isn't bridged soon enough, it gets harder to bond and reconcile as time passes by. Therefore, it is important for us to be on good terms with our partner's family.",
