db.LIItemLines.updateMany(
  { angleId: "AEN07" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP701",
          tipHeading: "It's okay to argue",
          tipBody:
            "It's common to associate arguments with incompatibility at the beginning of a relationship. Realize that conflicts are inevitable at every stage of your relationship. \n\nTherefore, do not confuse having arguments with being incompatible with your partner. An argument can be seen as a chance to know your partner better. We only argue with people we love.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN07/TIP701.png",
        },
        {
          tipId: "TIP702",
          tipHeading: "Use ‘I’ rather than ‘You’",
          tipBody:
            "When you're making a point to your partner that sounds like an argument, use 'I' rather than 'you'. Use statements such as ‘I felt hurt' instead of 'You hurt me'. \n\nThis encourages the partner to be more open and less defensive. You come across as not blaming your partner but rather explaining your feelings.\n\nIn this way, rather than ego clashes and fault-finding, the discussion involves empathizing and finding solutions. This makes managing conflicts smooth.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN07/TIP702.png",
        },
        {
          tipId: "TIP703",
          tipHeading: "Celebrate first argument",
          tipBody:
            "When you and your partner have resolved your first conflict, celebrate it like how you would celebrate your first kiss. You can give them a cute apology note, get ice cream, etc. \n\nCelebrating helps embrace arguments and accept that it is a normal part of a relationship. Having your first argument is a milestone in itself!",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN07/TIP703.png",
        },
        {
          tipId: "TIP705",
          tipHeading: "When to bring it up again?",
          tipBody:
            "Let's say you're ready to talk again after a heated argument. You've been restless. You want it resolved. Soon you start discussing it. \n\nNote that sometimes this backfires. Your partner may not have healed from the argument. They may need more time to be emotionally ready. Instead of discussing it when you are ready, discuss it when you both are.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN07/TIP705.png",
        },
      ],
    },
  }
);

