          tipId: "TIP10100",
          tipHeading: "Finding groove",
          tipBody:
            "Most of us tend to think that sex should instantly click with our partner. These misconceptions might be shaped by the kind of media we consume such as movies and novels. Asking our friends about their experiences might not always yield an honest answer. \n\nUnderstanding each other's sexual preferences, likes, dislikes and accommodating them takes time. Most couples experience this. This is totally normal.",
