db.LIItemLines.updateMany(
  { angleId: "AEN12" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP12100",
          tipHeading: "We own how we react",
          tipBody:
            "We tend to think that reacting aggressively when our partner provokes us is justified. We blame the partner. This is not healthy. We are responsible for our own emotions. We get angry not because someone provoked us, but because we got triggered. \n\nTriggers can be anything, such as a word, tone of voice, a past incidence, a thought, etc. Once we control our feelings, we can control the way we react to it. To take control of our feelings, we need to accept we are responsible for them. It is possible to still stay calm and react in a mature way even if our partner seems to provoke us.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12100.png",
        },
        {
          tipId: "TIP12101",
          tipHeading: "Discover your triggers",
          tipBody:
            "By knowing your triggers, you can change how you react. This helps you control negative emotions. \n\nTake a moment to reflect back on when you felt angry, sad, lonely, hopeless, etc., and what triggered those feelings. Note down these situations. Mention the emotions you felt in each situation. For example, 'My partner said no to a movie date. This is the third time they said no. I felt deeply hurt.' Recognize that them saying no is a trigger. Feeling hurt is your reaction to that trigger.\n\nList at least 10 such situations. It may take you 2-3 days to write them all down. The next time you face a similar trigger, resist the temptation to react. Tell yourself 'I feel this strong emotion'. Wait for 5 seconds before reacting or walking away, whichever feels more comfortable. In this way, you can control your negative emotions and improve the quality of your life.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12101.png",
        },
        {
          tipId: "TIP12102",
          tipHeading: "Emojis",
          tipBody:
            "If you are not great at identifying how you are feeling, get an emoji chart from Amazon and hang it on your wall. When you want to pin point your emotions, look at the various emojis in the chart and identify which ones you feel.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12102.png",
        },
        {
          tipId: "TIP12103",
          tipHeading: "Speed up",
          tipBody:
            "Consult a psychologist if you want to identify and address your triggers faster. You will be able to manage your emotions more effectively with their help.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12103.png",
        },
        {
          tipId: "TIP12104",
          tipHeading: "Release your anger",
          tipBody:
            "When you feel restless or have pent up emotions, try the primal scream technique to relieve them. Go somewhere you can't be heard. Let out a loud scream for as long as you can. Repeat it until you feel calm. \n\nIf you are into art, you can express your anger through coloring or painting. It will help you cool down.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12104png",
        },
        {
          tipId: "TIP12105",
          tipHeading: "Talk to someone",
          tipBody:
            "If you cannot identify situations where you felt triggered, ask your loved ones for help. They can remember and identify some of them. \n\nMake a list of them and display them where you can see them every day. You'll slowly become aware of your triggers and eventually, you'll be able to control your reactions to them.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN12/TIP12105.png",
        },
      ],
    },
  }
);

db.LIItemLines.updateMany(
  { angleId: "AEN13" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP13100",
          tipHeading: "Being Vulnerable",
          tipBody:
            "We avoid being vulnerable as we fear being hurt or judged by our partner. Your upbringing also influences this quality. If people around you dismissed you when you were vulnerable in the past, you might have closed yourself off. \n\nUnfortunately, as a society, we teach men not to be vulnerable, claiming it makes you less masculine. Realize that being vulnerable needs courage. It in fact makes you stronger because people trust you more. It also helps you connect deeper.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN13/TIP13100.png",
        },
        {
          tipId: "TIP13101",
          tipHeading: "At least say that you struggle to open up",
          tipBody:
            "If you feel uncomfortable opening up to your partner, you can talk to them about the feeling of discomfort itself. You can tell how hard it is for you to open up. \n\nThis conversation will give you the courage to open up more in the future. It will also help them understand your point of view better. Thus, it will improve your relationship.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN13/TIP13101.png",
        },
        {
          tipId: "TIP13102",
          tipHeading: "Ask yourself ' how I feel right now?",
          tipBody:
            "We always feel something, but we aren't in tune with it. \n\nOccasionally, ask yourself how you are feeling at this moment and be honest. If you pause and look deep, you will see that you are experiencing multiple emotions at any time. If some of these feelings are negative, tell yourself, ' It's okay, I am feeling this way. It's just a passing phase. Things will be alright'. \n\nExercises like this make us more self-aware and have a calming effect. It teaches us how to be vulnerable to ourselves, making it easier to be vulnerable to our partner.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN13/TIP13102.png",
        },
        {
          tipId: "TIP13103",
          tipHeading: "Happy Hour week",
          tipBody:
            "Every week, set aside some time for you and your partner to share something that made you happy that week. After sharing the happy memory, talk about something that made you feel unhappy that week. Ask your partner to share the same. \n\nThese conversations will help you and your partner become more comfortable opening up to each other.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN13/TIP13101.png",
        },
        {
          tipId: "TIP13104",
          tipHeading: "A journey together",
          tipBody:
            "When you set a new goal, keep your partner informed.Once in a while, express to your partner how things are going with respect to the goal. For example, if your goal is to lose weight, you can talk to your partner about your progress each week. \n\nDoing this will slowly make you accustomed to sharing your different emotions. Without realising you start to be vulnerable to your partner.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN13/TIP13101.png",
        },
      ],
    },
  }
);

db.LIItemLines.updateMany(
  { angleId: "AEN14" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP14101",
          tipHeading: "Let go of your ego and fear",
          tipBody:
            "Reaching out to your partner after a fight can be difficult because you fear how they may react. Sometimes we feel it's not our problem to make them feel better. Realise that your partner needs you the most when they are hurt and recovering. So we suggest that you embrace the fear. \n\nIt is also vital to put away your ego when it comes to your partner, as there is no ego in a relationship. Putting effort to reach out to them once you have recovered from a fight shows your unwavering support and how much you care for them. ",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN14/TIP14101.png",
        },
        {
          tipId: "TIP14102",
          tipHeading: "Be there for your partner",
          tipBody:
            "After letting go of your fear and ego post a heated argument with your partner, it might feel awkward to talk for a while. \n\nAfter you have recovered from the fight, stay with your partner. Position yourself, so your partner can see you or make your presence known. Physically being around your partner builds trust. \n\nThis action also calms your partner down. This will strengthen your bond. It allows you to relook at any unresolved issues that caused the original fight with a fresh perspective.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN14/TIP14102.png",
        },
        {
          tipId: "TIP14103",
          tipHeading: "Do something they like",
          tipBody:
            "If physically being around your partner feels hard to you after an argument, try to do something your partner likes instead. \n\nYou can get them their favorite food or play the music that cheers them up. Let your partner feel comforted by having them experience what they enjoy. This helps them calm down, thereby easing the conflict. ",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN14/TIP14103.png",
        },
      ],
    },
  }
);

db.LIItemLines.updateMany(
  { angleId: "AEN15" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP15101",
          tipHeading: "Arguing is not bad",
          tipBody:
            "Some of us might think that to keep peace in the relationship, we can skip some critical topics if it would cause a disagreement. Note that in a relationship, conflicts are inevitable. \n\nIt is unhealthy to avoid conflict by not discussing important issues. Silently suffering through it makes you unhappy slowly over time. Eventually, the issues you swept under the rug will surface and lead to even more serious conflict. \n\nTherefore, addressing the pressing issues is important even if it means risking conflict. ",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15101.png",
        },
        {
          tipId: "TIP15102",
          tipHeading: "How to have a crucial conversation?",
          tipBody:
            "If talking about the concerns feels difficult to you, follow this process. This helps you have a smooth conversation. \n\nFirstly, find a time when your partner is relaxed and has some time to talk. Once you start talking, mention how much you care about them and how you want both of you to be happy. Wait for their reaction. It is usually neutral or positive. This builds trust and makes them ready to absorb what you are about to present. \n\nThen talk about your concern, focusing mostly on where you are coming from, what your feelings are and how addressing it would make you feel better. Once you are done, let your partner speak freely. They may react positively or negatively. Either way, listen attentively and resist the urge to stop them. \n\nIf the discussion doesn't proceed as planned, apologize and mention we can discuss this later. Overall you at least got a chance to maturely bring it up. It will remain in the back of their minds.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15102.png",
        },
        {
          tipId: "TIP15103",
          tipHeading: "Pen it down",
          tipBody:
            "When you feel you can't talk to your partner about something important, write it down. Be gentle when expressing concern. Avoid harsh or abusive language. Do not blame your partner for the issue; instead, focus on yourself. Share it with your partner once you're done.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15103.png",
        },
        {
          tipId: "TIP15104",
          tipHeading: "Go for a walk",
          tipBody:
            "Whenever you feel uncomfortable talking or writing about your concern, try having a conversation with your partner in a position where you are not facing each other. You can do this by going for a walk with your partner. When you are not making eye contact and facing away from each other, talking becomes less awkward.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN15/TIP15104.png",
        },
        {
          tipId: "TIP702",
          tipHeading: "Use ‘I’ rather than ‘You’",
          tipBody:
            "When you're making a point to your partner that sounds like an argument, use 'I' rather than 'you'. Use statements such as ‘I felt hurt' instead of 'You hurt me'. \n\nThis encourages the partner to be more open and less defensive. You come across as not blaming your partner but rather explaining your feelings. \n\nIn this way, rather than ego clashes and fault-finding, the discussion involves empathizing and finding solutions. This makes managing conflicts smooth.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN07/TIP702.png",
        },
      ],
    },
  }
);

