          tipHeading: "Get clarity on expenses",
          tipBody:
            "Before you get married, make a list of your potential expenses during your first year as a married couple. This activity will help you understand your current financial situation. \n\nPlanning before marriage gives you an idea of what you are getting into financially. You can discuss with your partner where you spend the most money and what your recurring expenditures include. For example, you spend most of your money on loans while your partner spends most of their money on food. \n\nThis gives you clarity on the kind of expenses you both have individually.",
