          tipHeading: "Express how you feel",
          tipBody:
            "We often expect our partner to understand how we feel without explicitly telling them. Most of us don't pay attention to subtle signs in our facial expressions, tone of voice, body language etc. to recognise how someone is feeling. \n\nWhen we are feeling low and don't express, it  would result in pent-up emotions, and eventually causes an emotional outburst. This is not healthy. \n\nSo, it is essential to express your feelings directly. You need to express it in the right way at the right time.",
