db.LIItemLines.updateMany(
  { angleId: "AEN21" },
  {
    $set: {
      tipsToImprove: [
        {
          tipId: "TIP21100",
          tipHeading: "It's okay to over communicate",
          tipBody:
            "We tend to underestimate how much we have to communicate our wedding expectations to our partner's family. We mostly talk about high-level stuff like booking the hall, setting the date, etc. We tend to miss small details like who would pay if there were extra guests, which rituals the bride and groom should follow after the wedding, etc. \n\nNot communicating enough often leads to huge conflicts among families. Thus, we need to communicate our wedding expectations to our partner's family as thoroughly as possible.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN21/TIP21100.png",
        },
        {
          tipId: "TIP21101",
          tipHeading: "Start early, go deep",
          tipBody:
            "The families on both sides need to discuss in depth early on what happens before, during, and after the wedding. \n\nDecide who should handle what and when. What arrangements are necessary for close relatives, friends, and well-wishers from both families?  Discuss finances, such as who will pay for the wedding and who will cover unexpected costs. ",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN21/TIP21101.png",
        },
        {
          tipId: "TIP21102",
          tipHeading: "Be ready for the unexpected",
          tipBody:
            "Many issues can occur when planning a wedding. These include unexpected wedding costs, not being aware of the major and minor differences in family traditions, people forgetting things, people misunderstanding what was told to them, last minute change in plans, delays everywhere, etc. \n\nThe wedding planners on both sides should stay in touch throughout. Avoid making any assumptions. It is better to over-communicate than to under-communicate. This way, the wedding can go smoothly.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN21/TIP21102.png",
        },
        {
          tipId: "TIP21103",
          tipHeading: "Be forgiving",
          tipBody:
            "Try to be accommodative and forgiving of both of your families for the mess ups that are bound to happen. \n\nThere will be a few unpleasant surprises along the way. For instance, your family has a tradition that the groom rides a horse to the wedding. Despite their best efforts, the groom's family may not be able to make it happen and comes by car instead. In such scenarios, it's best to take it easy and enjoy the wedding.",
          tipImgUrl:
            "https://hae-public-bucket.s3.ap-south-1.amazonaws.com/HMA/TipImg/AEN21/TIP21103.png",
        },
      ],
    },
  }
);

