          tipBody:
            "As we grow older, we believe it is important to get married. Getting financially stable before you get married is always a good idea. \n\nUnderstand that financial hardship has an impact on your relationship. You don't want to start a marriage in hardships. Once you get married, conflicts may arise because of money constraints. Marriage adds new expenses that you may not be aware of. \n\nHence, we recommend you to wait even if you are growing old till your combined income is sufficient to cover your basic needs.",
