            "Recall when you said 'no' to your partner in the past that you feel can be worked upon now. Take baby steps to fulfill that. \n\nFor example, if your partner wanted to watch a Korean movie with you that you denied in the past, take a small step by watching a few trailers together with your partner. You'll be pleasantly surprised by how happy your partner would feel.",
