            "We often underestimate the compromises and sacrifices our partner has made for our relationship. \n\nIn a relaxed setting, ask your partner about the compromises they have made. Listen with an open mind without judging or comparing with yours. It is usually humbling to listen to how much they have done for you. Give them a big hug. \n\nNext time, when you feel you need to adjust to accommodate your partner, remember what they have done for you.",
