          tipId: "TIP16100",
          tipHeading: "It's okay to seek assistance",
          tipBody:
            "Most of us tend to think that conflicts between the couple shouldn't be revealed to outsiders. We think it's shameful to talk about it. In most cases, couples can resolve conflicts themselves. \n\nHowever, there can be some hard to resolve issues such as abuse or infidelity that can persist for more than 6 months. They may require external support. It might be too hard for you to deal with these issues alone. Remember, it's okay to seek help.",
