          tipId: "TIP20102",
          tipHeading: "Figure out why",
          tipBody:
            "If you're unable to get along with your partner's parents, try to figure out why. It could be their attitude or behaviour or a past incident that is stopping you from talking to them. \n\nOnce you identify the reason, talk to them and understand where they're coming from and why they behave in that way. This conversation will help you to understand their point of view and become more tolerant of them.",
