          tipHeading: "Patience is the key!",
          tipBody:
            "When our partner doesn't seem to comprehend what we're trying to say, we think it's best to move on. At times, we feel impatient. Recognize that sometimes it can be difficult for our partner to understand us. If we don't take the time to make them understand, they might feel disrespected. \n\nImagine how you would feel if your partner gives up when you don't understand what they are trying to say. They deserve our patience and efforts. It builds good team spirit.",
